import MyButton from '../components'

const PostItem = (props) => {


  return (
      <div className="post">
        <div className="post__items">
          <strong>{props.number}. {props.post.title}</strong>
          <div>{props.post.body}</div>
        </div>
        <div className="btns">
          <MyButton>Удалить</MyButton>
        </div>
      </div>

  )
};

export default PostItem;
